import * as React from 'react';
import Card from './Card';
import { Module } from './ISpFxWebpartSalesToolsProps';

interface CarouselProps {
    courses: Module[];
    selectedFilter: string;
    selectedProduct: string;
    uniqueRoles: string[];
}

const Carousel: React.FC<CarouselProps> = ({ courses, selectedFilter, selectedProduct, uniqueRoles }) => {
    const [currentIndex, setCurrentIndex] = React.useState(0);
    const [cardWidth, setCardWidth] = React.useState(25);

    // Filter courses based on selectedFilter and selectedLevel
    const filteredCourses = courses?.filter((course) => {
        // if selectedFilter is 'Tool'
        if (selectedFilter === 'Tool') {
            // filter by course tool
            if (selectedProduct === 'All' || course.course === selectedProduct) {
                return true;
            }
        }

        // if selectedFilter is 'adsm'
        if (selectedFilter === 'ADSM') {
            // filter by course adsm
            if (selectedProduct === 'All' || course.adsm.includes(selectedProduct)) {
                return true;
            }
        }
        if (selectedFilter === 'Role') {
            if (selectedProduct === 'All') {
                return true;
            }

            // Check if selectedLevel exists in uniqueRoles
            const roleIndex = uniqueRoles.indexOf(selectedProduct);
            if (roleIndex !== -1 && course.adsm.includes((roleIndex + 1).toString())) {
                return true;
            }
        }

        return false; // otherwise, don't display the course
    });

    // // Update card width based on screen size
    React.useEffect(() => {
        const updateCardWidth = (): void => {
            if (window.innerWidth >= 1920) {
                // 5 cards for wide screen
                setCardWidth(20);
            } else if (window.innerWidth >= 2560) {
                // 6 cards for desktop
                setCardWidth(100 / 6);
            } else {
                // 4 cards for laptop
                setCardWidth(25);
            }
        };

        updateCardWidth();
        window.addEventListener('resize', updateCardWidth);
        return () => window.removeEventListener('resize', updateCardWidth);
    }, []);

    // Reset currentIndex when the filtered courses change
    React.useEffect(() => {
        setCurrentIndex(0);
    }, [filteredCourses?.length]);

    const [left, setLeft] = React.useState(false); // State for showing/hiding the left arrow
    const [right, setRight] = React.useState(false); // State for showing/hiding the right arrow

    // Function to handle the "Next" button click
    const handleNext = (): void => {
        setCurrentIndex((prevIndex) => (prevIndex + 1) % filteredCourses?.length);
    };

    // Function to handle the "Previous" button click
    const handlePrev = (): void => {
        setCurrentIndex((prevIndex) =>
            (prevIndex - 1 + filteredCourses?.length) % filteredCourses?.length
        );
    };

    // Show right arrow if the currentIndex is at the end of the filteredCourses list
    React.useEffect(() => {
        if (currentIndex > filteredCourses?.length - 4) {
            setRight(true);
        }
        else {
            setRight(false);
        }
    }, [currentIndex, filteredCourses]);

    // Show right arrow if the currentIndex is at the beginning of the filteredCourses list
    React.useEffect(() => {
        if (currentIndex === 0) {
            setLeft(true);
        }
        else {
            setLeft(false);
        }
    }, [currentIndex, filteredCourses]);

    return (
        <div className='relative w-full mx-auto overflow-visible'>
            {/* Carousel */}
            <div
                className="overflow-hidden"
                style={{ width: '100%' }}
            >
                <div
                    className="flex transition-transform duration-500 ease-in-out"
                    style={{ transform: `translateX(-${currentIndex * cardWidth}%)` }}>
                    {/* Map through the filtered courses and render each course as a Card */}
                    {filteredCourses?.map((module, index) => (
                        <div key={index} className="w-1/4 widescreen:w-1/5 desktop:w-1/6 flex-shrink-0">
                            <Card module={module} />
                        </div>
                    ))}
                </div>
            </div>

            {/* Right arrow button */}
            {!right && (
                <button className="z-10 absolute top-1/2 right-0 transform -translate-y-1/2 rounded-full " onClick={handleNext}>
                    <svg width="40" height="40" viewBox="0 0 40 40" fill="none" xmlns="http://www.w3.org/2000/svg" xmlnsXlink="http://www.w3.org/1999/xlink">
                        <path d="M40 20C40 31.0457 31.0457 40 20 40C8.9543 40 0 31.0457 0 20C0 8.9543 8.9543 0 20 0C31.0457 0 40 8.9543 40 20Z" fill="white" />
                        <path d="M0 0H40V40H0V0Z" fill="url(#pattern0_57852_194)" />
                        <defs>
                            <pattern id="pattern0_57852_194" patternContentUnits="objectBoundingBox" width="1" height="1">
                                <use xlinkHref="#image0_57852_194" transform="translate(0 -0.000413565) scale(0.00082713)" />
                            </pattern>
                            <image id="image0_57852_194" width="1209" height="1210" preserveAspectRatio="none" xlinkHref="data:image/png;base64," />
                        </defs>
                    </svg>

                </button>
            )}

            {/* Left arrow button */}
            {!left && (<button className="z-10 absolute top-1/2 left-[-16px] -translate-y-1/2  rounded-full " onClick={handlePrev}>
                <svg width="40" height="40" viewBox="0 0 40 40" fill="none" xmlns="http://www.w3.org/2000/svg" xmlnsXlink="http://www.w3.org/1999/xlink" style={{ transform: 'scaleX(-1)' }}>
                        <path d="M40 20C40 31.0457 31.0457 40 20 40C8.9543 40 0 31.0457 0 20C0 8.9543 8.9543 0 20 0C31.0457 0 40 8.9543 40 20Z" fill="white" />
                        <path d="M0 0H40V40H0V0Z" fill="url(#pattern0_57852_194)" />
                        <defs>
                            <pattern id="pattern0_57852_194" patternContentUnits="objectBoundingBox" width="1" height="1">
                                <use xlinkHref="#image0_57852_194" transform="translate(0 -0.000413565) scale(0.00082713)" />
                            </pattern>
                            <image id="image0_57852_194" width="1209" height="1210" preserveAspectRatio="none" xlinkHref="data:image/png;base64," />
                        </defs>
                    </svg>

            </button>)}
        </div>
    );
};

export default Carousel;